import { createGlobalStyle } from 'styled-components';
<style>
  @import url('https://fonts.googleapis.com/css2?family=Sora:wght@400;700&display=swap');
</style>

export default createGlobalStyle`
    * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
        font-family: Sora
    }
`;
